import React from 'react';
import { TrendingUp, Clock, Coins } from 'lucide-react';

const StrategyCard = ({ strategy }) => {
  return (
    <div className="strategy-card">
      <div className="strategy-header">
        <h3 className="strategy-title">{strategy.title}</h3>
        <span className={`strategy-status status-${strategy.status}`}>
          {strategy.status}
        </span>
      </div>

      <div className="strategy-details">
        <div className="strategy-detail">
          <span><Coins size={16} /> Current Asset:</span>
          <span>{strategy.coin}</span>
        </div>
        <div className="strategy-detail">
          <span><Clock size={16} /> Created:</span>
          <span>{strategy.createdAt}</span>
        </div>
        <div className="strategy-detail">
          <span><TrendingUp size={16} /> Last Update:</span>
          <span>{strategy.lastUpdate}</span>
        </div>
      </div>

      <div className="strategy-description">
        {strategy.description}
      </div>
    </div>
  );
};

export default StrategyCard;
